              className={
                statArrow === "up"
                  ? "fas fa-arrow-up"
                  : "fas fa-arrow-down"
              }
            ></i>{" "}
            {statPercent}%
          </span>
          <span className="whitespace-nowrap">{statDescripiron}</span>
        </p> */}
      </div>
    </div>
  );
}
